E cada um com sua história, sua personalidade e desejos fiquei super empolgada em saber quem iria conquistar de vez o coração daquela pobre mulher que se manteve solteira, desistiu de seus sonhos para criar a filha sozinha...
Outro ponto que me prendeu foi a pergunta que não queria se calar.
Quem é o pai? E qual toda a história por trás desse "abandono".
Para mim tinha um prato cheio para tudo ser mais enérgico e empolgante, porém achei tudo parado, enrolado e com muitas coisas que foram deixadas de lado.
Queria ver a protagonista sendo sincera com a filha, ela teve a oportunidade de colocar tudo em seu devido lugar, explicar o terrível mal entendido, que o término foi manipulado e assim fazer com que pai e filha tivesse a chance de uma aproximação, de tentar juntos correr atrás do tempo perdido, mas preferiu tirar o seu da reta pois ela tinha sua parcela de culpa e resolveu fazer a egípcia, fiquei muito decepcionada com essa protagonista nem a própria mãe sabia quem era o pai da neta, ela de fato deu seu perdão a todos, menos a quem realmente merecia e somente depois de um acidente grave ela resolveu enfim dar uma chance.
O professor tadinho, só serviu de enfeite, pois não teve nenhum avanço em sua história.
O ator teve seus avanços , mas nada de tão empolgante. 
O investidor, vulgo dono da quebrada tem uma história super interessante e amei seu relacionamento com o filho foi fortalecido pela verdade, apenas me incomodou aquele gostinho de romance com a dona do bar que ficou ali só na vontade mesmo.
O escritor foi totalmente feito de babaca e não tomou devidamente as rédeas da situação, pelo contrário se deixou levar pela opinião alheia.
A atuação das crianças foi o que mais salvou esse drama, as cenas deles juntos construindo uma amizade e confiança um no outro era super fofo de se ver.
Para mim esse drama foi mais um que tinha um grande potencial só que se perdeu no meio do caminho.
